let checkForMatch = (obj2, rs) => {
    let found = false;
    for (const obj of rs) {
        if (objectEquals(obj, obj2)) {
            found = true;
            break;
        }
    }
    return found;
}

function objectEquals(o1, o2) {
    let eq = true;
    for (const key in o1) {
        if (o2[key] != o1[key]) {
            eq = false;
            break;
        }
    }
    return eq;
}

function readJson(file) {
    let rawdata = fs.readFileSync(file);
    return JSON.parse(rawdata);
}

